import './App.css';
import { Navbar } from './components/Navbar';
function App() {

  const links = [
    { text: 'Inicio', url: '/' },
    { text: 'Acerca de', url: '/about' },
    { text: 'Contacto', url: '/contact' },
  ];

  return (
    <>
      <Navbar links={links} />
    </>
  );
}

export default App;
